import dice from "./dice.png";
import "./card.css";
const Card = (props) => {

    return (
        <div className="cardbody col-sm-6 col-md-4 col-lg-3 ml-2 mt-1 flex">
            <div className="card-body1 ">
                <div className="card-header1 img-thumbnail">
                    {/* <img src="https://picsum.photos/seed/picsum/252/252" alt="dice" /> */}
                    <img src={props.image} alt="dice" />
                </div>
                <div className="card-footer1 img-thumbnail">
                    <p>{props.heading}</p>
                    <p>Publisher - 05/06/2023</p>
                    <p>Lorem ipsum dolor sit, amet consectetur adipisicing elit.</p>
                </div>
            </div>
        </div>

    );

}

export default Card;
